import sun from './sun.png';
import rain from './rain.png';
import snow from './snow.png';
import windIcon from './wind-icon.png';
import rainIcon from './rain-icon.png';
import temIcon from './tem-icon.png';
import cloud from './cloud.png';
import overcast from './overcast.png';

export default {
  sun,
  rain,
  snow,
  cloud,
  overcast,
  temIcon,
  windIcon,
  rainIcon,
};
